B.Ig=A.a(s(["Blind Fighting Style means that both you and the dragon have blindsight, and you can fight side-by-side to gain its Magic Resistance trait.","Choose the Marid Genie, and get Pact of the Chain for a Pseudodragon familiar.","Cast Fog Cloud centered on an opponent and move up to them, and have your Pseudodragon sting them.","You can prevent their escape with Sentinel, Compelled Duel, and/or Champion Challenge.","With the boost from Investment of the Chain Master, there's a decent chance that the Pseudodragon can knock your opponent out, letting you get a massive critical Divine Smite.","This build works especially well if you have a party member with Darkness or Fog Cloud, so you can concentrate on Compelled Duel."]),t.s)
