B.K2=A.a(s(["With Hexblade's Curse, Vow of Enmity, and Elven Accuracy, you'll get a critical hit 27% of the time.","Then you can use Divine Smite, Eldritch Smite, and Psychic Blades on the same hit for atrocious amonts of damage."]),t.s)
