B.Ii=A.a(s([u.t,"Then continue with Paladin from there.","Pick whatever Sacred Oath looks good to you, and make sure you grab the Polearm Master feat at some point."]),t.s)
B.Kz=A.a(s(["The spear runs on Charisma and gets an extra hit with Polearm Master.","Each hit is damage-boosted by Dueling Fighting Style, Hexblade's Curse, Improved Divine Smite, and whatever spell you wanna cast (e.g. Divine Favor/Spirit Shroud/Holy Weapon)"]),t.s)
B.AJ=new A.bl("The Stick Figure",B.KM,B.jj,"Who knew a simple weapon could be so awesome?",B.Ii,B.Kz,"any")
