B.Il=A.a(s(["15 Strength or 14 Dexterity","high Charisma"]),t.s)
B.K7=A.a(s(["Take one Fighter level, and then take a level of Hexblade Warlock.","Then pick your favorite out of those two classes and take it to level 5.","From there, which levels you take is up to you. Hexblade 5 is great thanks to Eldritch Smite, Samurai 7 is great if you have a good Wisdom score, and Samurai 11 is really good if you can make it there.","Make sure you grab the Elven Accuracy feat as soon as you can."]),t.s)
