B.Km=A.a(s(["You get 4 Superiority Dice as a Battle Master, and you can get a fifth with the Superior Technique Fighting Style.","On your turn, use Quick Toss to get your Sneak Attack, and use your Action to ready another dagger.","If you miss the Quick Toss, use Action Surge. This lets you get your Sneak Attack off twice each round!"]),t.s)
