B.K5=A.a(s(["Take 3 Rogue levels and then do Fighter from there.","Make sure you grab the Healer feat as soon as you can."]),t.s)
B.Hc=A.a(s(["You don't need fancy magic to support your friends! Fast Hands & Healer lets you pop up an ally as a bonus action.","Rallying Cry is another great way to do it.","Take the Superior Technique Fighting Style and/or the Martial Adept feat, so you can perform supportive maneuvers (like Distracting Strike, Goading Attack, Maneuvering Attack, or Bait and Switch)"]),t.s)
