B.JZ=A.a(s(["Magic missile is awesome. It always hits, and since each missile uses the same damage roll, it isn't hard to get the damage numbers up super high.","Cast an overchanneled Bestow Curse through your familiar, and then use Hexblade's Curse & Fury of the Small.","A level 7, magic missile will deal an average of 355.5 damage on a single turn!","Some DMs will rule that magic missile uses multiple damage rolls, which means that Fury of the Small and Empowered Evocation only apply once. This reduces the average total damage to 168.5.","Other DMs will have the enemy cast a level 1 shield spell. This reduces the average total damage to 0."]),t.s)
