B.An=new A.bl("The Spellsword",B.Ho,B.KY,"Weapons + Magic = fun times.",B.K3,B.KH,"Be an Elf/Half-Elf to get Elven Accuracy, or do Variant Human/Custom Lineage for a head start on feats.")
