B.KL=A.a(s(["Your attacks, stunning strikes, and spells all run on Wisdom, and you get to use Plate Armor and a shield.","Access to Divine Favor/Shield of Faith/Spirit Shroud make it even better, and the abundance of spells and features gives you a lot of good options for your action & bonus action each turn."]),t.s)
B.As=new A.bl("The Platinum Star",B.La,B.JN,"Hunker down in plate armor and let your avatar take care of things.",B.KV,B.KL,"Dwarf\u2014your armor won't slow you down, and you can get Dwarven Fortitude to go with Patient Defense.")
